import React from 'react';
import { NavLink } from 'react-router-dom';

function MainTabs() {
    return (
        <div className="tabs-container">
            <NavLink to="/comprehensive-analysis" activeClassName="active-tab">종합 분석</NavLink>
            <NavLink to="/technical-analysis" activeClassName="active-tab">테크니컬 분석</NavLink>
            <NavLink to="/indicator-analysis" activeClassName="active-tab">지표 분석</NavLink>
        </div>
    );
}

export default MainTabs;
